import React from 'react';
import { AiFillCaretRight, AiFillCaretLeft } from "react-icons/ai";
import './Btn.css';

const Btn = ({ handlePrevPage, handleNextPage }) => {
	return (
		<div className='btn'>
			<button onClick={handlePrevPage}>
				PREV
				<i></i>
			</button>
			<button onClick={handleNextPage}>
				NEXT
				<i>
				<AiFillCaretRight/>
				</i>
			</button>
		</div>
	);
};

export default Btn;
